//Contant.js-module

import { React,  Component } from 'react';
import { connect } from 'react-redux';
import { bindActionCreators} from 'redux'

import EmpAction from "../../actions/EmpAction";

//Create Contact Component

class Contact extends Component()
{
  constructor(props)
  {
   super(props)
   this.state = {}
  }

  componentDidMount()
  {
      this.props.EmpAction();
  }  

                      
  
render()
{
  return(<>
    <h1>Contact COMPONENT </h1>
    
    <p>Games, puzzles, and other fun activities to help kids practice letters, numbers, and more! Step-by-Step 
        Learning Path designed to help kids learn math, reading, science, and more. Completely Child Safe. Award Winning Program. Add Up to 3 Kids.
         Learn on Any Device. Cancel Anytime.</p> 
  
         <br></br>

        {
          this.props.empdata.map((res,i) =>
          {
              return(<ul key={i}>
                  <li>{res.id}</li>
                  <li>{res.name}</li>
                  <li>{res.email}</li>
                  <li>{res.phone}</li>
              </ul>)
          })
        } 


  </>)
    // return("This is Functional Component")

    
}

}

function mapStateToProps(state) 
{
  return({
    empinto:state.EmpReducer
  })
}

function mapDispatchToProps(dispatch) 
{
  return bindActionCreators({EmpAction},dispatch)
}
export default connect(mapStateToProps,mapDispatchToProps)(Contact);
